            var canvas = document.getElementById('ttygif');
            var ctx = canvas.getContext("2d");
            var id2 = ctx.createImageData(512,76);
            var id2d  = id2.data;                        
          
            function put_pixel(x,y,color_index){
                var color=frame['color_table'][color_index]
                var off = (y * id2.width + x) * 4;

                id2d[off+0]   = color[0];
                id2d[off+1]   = color[1];
                id2d[off+2]   = color[2];
                id2d[off+3]   = 255;
            }

            function fill(color_index){
                var color=frame['color_table'][color_index]
                var r=color[0];
                var g=color[1];
                var b=color[2];
            
                ctx.fillStyle = "rgb("+r+","+g+","+b+")";
                ctx.fillRect( 0, 0, frame['width'], frame['height'] );
            }

            function draw_frame(){
                var cx=0;
                var cy=0;
                var color_index=0;
                width=frame['width']
                height=frame['height']
                len_of_frame=frame['data'].length
                
                for(i=0;i<len_of_frame;i++){
                    color_index=frame['data'][i]
                    put_pixel(cx,cy,color_index)
                    cx++;
                    if(cx==width){
                        cx=0;
                        cy++;
                    }
                }
                ctx.putImageData(id2,0,0);
            }

            
            fill(0);
            draw_frame()
